import React, { useEffect } from "react";
import { firestore } from "../index";
import { Link } from "react-router-dom";

const ListRecord=()=>{
    const[data,setData]= useState({})
}

useEffect(()=>{
    firestore.child('Products').on('value',(snapshot)=>{
        if(snapshot.val() !==null){
            setData({
                ...snapshot.val(),
            });
        } else{
            snapshot({})
        }
    })
},[])
